let isInitialized=!1;const addCollapsibleCallouts=()=>{if(console.log(isInitialized),isInitialized){console.log("Collapsible Callouts already added!");return}const e=document.querySelectorAll("blockquote.callout-collapsible");e.length!=0&&(console.log("Adding Collapsible Callouts"),e.forEach(e=>e.addEventListener("click",e=>{e.currentTarget.classList.toggle("callout-collapsed")})),isInitialized=!0)}